import React, { Component } from "react";
import { MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavItem, MDBNavLink, MDBNavbarToggler, MDBCollapse, MDBDropdown,
MDBDropdownToggle, MDBDropdownMenu, MDBDropdownItem, MDBIcon, MDBContainer } from "mdbreact";

class TagList extends Component {

render() {
  return (
    <MDBCard className="card mb-4 text-center wow fadeIn">
                        <MDBCardHeader className="card-header">
                                <h4 className="mb-4">
                                    <strong>Popular Tags</strong>
                                </h4>
                                </MDBCardHeader>

                            <MDBCardBody className="card-body">
                            <MDBBadge className="trigger dark-green mr-2 lighten-4">Entertainment</MDBBadge>
                            <MDBBadge className="trigger dark-green mr-2 lighten-4">Cities</MDBBadge>
                            <MDBBadge className="trigger dark-green mr-2 lighten-4">Travel</MDBBadge>
                            <MDBBadge className="trigger dark-green mr-2 lighten-4">Adventures</MDBBadge>



                            </MDBCardBody>

                        </MDBCard>
    );
  }
}

export default TagList;
